import React from 'react';
import '../../App.css';
import Footer from '../Footer';
// import './Pages.css';
import Section from '../ResumeSections.js';
import '../ResumeSections.css';


function Projects() {
    return (
        <>
          <Section 
            title="30-Day Adulting iOS app"
            style="name"
          >
            <div>
              <p>Role: Programmer</p>
              <p></p>
            </div>
          </Section>
        </>
    );
}

export default Projects;
